import React, {Component} from 'react';
import Particles from 'react-particles-js';

class ComponentParticles extends Component{
    render(){
        return (
            <Particles 
            params={{
                  particles: {
                    shape: {
                        type: 'stars',
                    },
                      line_linked: {
                          shadow: {
                              enable: true,
                              color: "#3CA9D1",
                              blur: 5
                          }
                      }
                  }
              }}
            style={{
              backgroundColor: 'black',
              width: '100vh',
              position: 'absolute'
            }}
          />
        );
    };

}


export default ComponentParticles;
